import styles from './boatoInscrever.module.css';
import './boatoInscrever.module.css';


function botaoInscricao(){
    return(
<div class="botao_inscricao">
    <button className={styles.botao_inscrever}>Inscreva-se</button>
   </div>
    
)
}

export default botaoInscricao;
